  false,\n\t\"url\": null,\n\t\"notes\": \"Ammonium, nitrate, nitrite, phosphate,
  silicate, and urea data were collected from the R/V ALPHA HELIX from July 13, 1985
  to October 14, 1985. Data were submitted by University of Alaska - Fairbanks; Institute
  of Marine Science and California Dept of Fish and Game as part of the Inner Shelf
  Transport and Recycling Project (ISHTAR). Data were collected using bottle casts
  in the Bering Sea and Northeast Pacific Ocean.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
